import {
  Box,
  FormControl,
  Grid,
  InputLabel,
  MenuItem,
  Select,
  Typography,
} from "@mui/material";
import { Theme } from "../../others/Theme";

export const SelectBlock = ({ value, label, onChange }) => {
  const tagsArr = ["Art", "Photo"];
  const blockchainArr = ["Public", "Private"];
  return (
    <Grid xs={14} md={9}>
      <Box
        sx={{
          bgcolor: Theme.palette.secondary.light,
          boxShadow: 1,
          borderRadius: 5,
          p: 2,

          "&:hover": {
            backgroundColor: Theme.palette.secondary.main,
          },
        }}
      >
        <Typography>select tag</Typography>
        <FormControl sx={{ m: 1, minWidth: 120 }}>
          <InputLabel>{label}</InputLabel>
          <Select value={value} label={label} onChange={onChange}>
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            {label === "tag"
              ? tagsArr.map((tag) => <MenuItem value={tag}>tag</MenuItem>)
              : blockchainArr.map((blockchain) => (
                  <MenuItem value={blockchain}>blockchain</MenuItem>
                ))}
            // <MenuItem value={"art"}>Art</MenuItem>
            // <MenuItem value={"photo"}>Photo</MenuItem>
          </Select>
        </FormControl>
      </Box>
    </Grid>
  );
};
